    false,nt"url": null,nt"notes": "This 2' x 4' gravity density grid for Alaska
    displays the distribution of about 1.1 million terrestrial and marine gravity data
    held in the National Geodetic Survey gravity data base in July 1996. These data
    were augmented by gravity data contributions from NGA (former National Imagery and
    Mapping Agency (former Defence Mapping Agency)) and by satellite altimeter-derived
    marine gravity anomalies computed by Sandwell and Smith (1996). The values show
    the number of gravity data contained in a given 2' x 4' cell. Additional information
    is available at http://www.ngs.noaa.gov/GEOID/geoid.htmlWe are particularly grateful
    to NGA (former National Imagery and Mapping Agency) for their assistance and their
    data contributions.",nt"license_title": null,nt"extras": [{ntt"key":
